namespace GrandChase.Function
{
    public class Shop
    {
        public int Quantidade = 1;
        public int CountBuy = 0;
        public struct goodsItems
        {
            public int goodsid;
            public string goodsName;
            public byte itemType;
            public int Price;
            public int chartype;
        }
        public goodsItems[] goodsIttems = new goodsItems[0];

        public void LoadShop()
        {
            DataSet ds = new DataSet();
            Database.Query(ref ds, "SELECT * FROM `gc`.`goodsinfolist`");

            // 캐릭터 배열 사이즈 늘리기
            Array.Resize(ref goodsIttems, ds.Tables[0].Rows.Count);

            for (int i = 0; i < ds.Tables[0].Rows.Count; i++)
            {
                goodsIttems[i].goodsid = Convert.ToInt32(ds.Tables[0].Rows[i]["GoodsID"].ToString());
                goodsIttems[i].goodsName = Convert.ToString(ds.Tables[0].Rows[i]["GoodsName"].ToString());
                goodsIttems[i].itemType = Convert.ToByte(ds.Tables[0].Rows[i]["itemtype"].ToString());
                goodsIttems[i].Price = Convert.ToInt32(ds.Tables[0].Rows[i]["price"].ToString());
                goodsIttems[i].chartype = Convert.ToInt32(ds.Tables[0].Rows[i]["chartype"].ToString());
            }
        }

        public void ContainGoods(int goods)
        {
            for (int a = 0; a < goodsIttems.Length; a++)
            {
                if (goodsIttems[a].goodsid == goods)
                {
                    return;
                }
            }
        }


        public void CashRatio(ClientSession cs)
        {
            using (OutPacket oPacket = new OutPacket(GameOpcodes.EVENT_CASHBACK_EXTRA_RATIO_INFO_ACK))
            {
                oPacket.WriteHexString("00 00 00 00 FF FF FF FF 00 00 00 00");
                oPacket.CompressAndAssemble(cs.CRYPT_KEY, cs.CRYPT_HMAC, cs.CRYPT_PREFIX, ++cs.CRYPT_COUNT);
                cs.Send(oPacket);
            }
        }

        public void packageInfo(ClientSession cs)
        {
            using (OutPacket oPacket = new OutPacket(GameOpcodes.EVENT_PACKAGE_INFO_ACK))
            {
                oPacket.WriteHexString("00 00 00 02 00 00 00 01");
                oPacket.CompressAndAssemble(cs.CRYPT_KEY, cs.CRYPT_HMAC, cs.CRYPT_PREFIX, ++cs.CRYPT_COUNT);
                cs.Send(oPacket);
            }
        }


