        public void CheckItem(ClientSession cs,InPacket ip)
        {
            int Itemid = ip.ReadInt();
            using (OutPacket oPacket = new OutPacket(GameOpcodes.EVENT_ITEM_BUY_CHECK_ACK))
            {
                oPacket.WriteInt(1);
                oPacket.WriteInt(Itemid);
                oPacket.CompressAndAssemble(cs.CRYPT_KEY, cs.CRYPT_HMAC, cs.CRYPT_PREFIX, ++cs.CRYPT_COUNT);
                cs.Send(oPacket);
            }
        }

        public void BuyItem(ClientSession cs,int ItemID,int Quantity)
        {
            //Quantidade = 0;
            DataSet ds2 = new DataSet();
            Database.Query(ref ds2, "SELECT `Quantity` FROM `gc`.`inventory` WHERE `LoginUID`='{0}' AND `ItemID`='{1}'", cs.LoginUID, ItemID);
            if (ds2.Tables[0].Rows.Count == 0)
            {
                Quantidade = Quantity;
                DataSet ds = new DataSet();
                Database.Query(ref ds, "INSERT INTO `gc`.`inventory` (  `LoginUID`,  `ItemID`,  `Quantity`) VALUES  (    '{0}',    '{1}',    '{2}'  )", cs.LoginUID, ItemID,Quantity);
            }
            else
            {
                if (Quantidade == 0)
                {
                    Quantidade = Convert.ToInt32(ds2.Tables[0].Rows[0]["Quantity"].ToString());
                }
                else
                {
                    Quantidade = (Convert.ToInt32(ds2.Tables[0].Rows[0]["Quantity"].ToString()))+1;
                }
                LogFactory.GetLog("BUITEM").LogInfo("ITEMID: "+ItemID+" QUANTIDADE: "+Quantidade);
                DataSet ds3 = new DataSet();
                Database.Query(ref ds3, "update   `gc`.`inventory` set  `Quantity` = '{2}' where `LoginUID` = '{0}'   AND `ItemID` = '{1}'", cs.LoginUID, ItemID, Quantidade+1);
            }
        }

        public int LoadType(int itemID)
        {
            int itemType;
            DataSet ds = new DataSet();
            Database.Query(ref ds, "SELECT Kind FROM `gc`.`goodsinfolist` WHERE `GoodsID`= '{0}'", itemID);
            if (ds.Tables[0].Rows.Count == 0)
            {
                itemType = 0;
            }
            else 
            {
                itemType = Convert.ToInt32(ds.Tables[0].Rows[0]["Kind"].ToString());
            }
            return itemType;
        }

